    // const weather = [
    //     one,
    //     two,
    //     three,
    //     four,
    //     five,
    //     six,
    //     seven,
    // ]

    const generateDays = (weather) => {
        if (props.weather){
            weather.map(weather => <div>{weather.data}</div>)
        }
    }

    // const generateDays = (weather) => {
    //     return weather.map(weather => <div>{weather.data}</div>)
    // }

    return(
        <div id='fivecast'>
            <h1>FiveCast</h1>
